import { NavLink } from "react-router-dom"

const Header = () => {
  return (
      <nav>
          <NavLink to="/">Home</NavLink>
          <NavLink to="/about">About</NavLink>
          <NavLink to="/resume">Resume</NavLink>
          <NavLink to="/my-work">My Work</NavLink>
      </nav>
  )
}

export default Header
